import React, { Component } from "react";
import "./Car.css";

class Car extends Component {
  state = {};

  showCarDetails() {}

  render() {
    const { id } = this.props.car;
    return (
      <div className="Car">
        {
          <div>
            <div title={id} onClick={this.showCarDetails}>
              Car: {id}
            </div>
          </div>
        }
        <div> Model: {/*{car.model}*/}</div>
      </div>
    );
  }
}

export default Car;
